    public ModelPart root() {
        return this.root;
    }    @Override
    public void setupAnim(BlackBool pEntity, float pLimbSwing, float pLimbSwingAmount, float pAgeInTicks, float pNetHeadYaw, float pHeadPitch) {
        ModelPart rootPart = this.root();        rootPart.yRot = pNetHeadYaw * ((float)Math.PI / 180F);
        rootPart.xRot = pHeadPitch * ((float)Math.PI / 180F);        int laserTargetId = pEntity.getLaserTargetId();        if (laserTargetId > 0) {
            Entity laserTarget = pEntity.level().getEntity(laserTargetId);            if (laserTarget != null) {
                float partialTicks = pAgeInTicks - pEntity.tickCount;                Vec3 targetPos = new Vec3(
                        Mth.lerp(partialTicks, laserTarget.xOld, laserTarget.getX()),
                        Mth.lerp(partialTicks, laserTarget.yOld, laserTarget.getY()) + laserTarget.getEyeHeight(),
                        Mth.lerp(partialTicks, laserTarget.zOld, laserTarget.getZ())
                );                Vec3 bossEyePos = new Vec3(
                        Mth.lerp(partialTicks, pEntity.xOld, pEntity.getX()),
                        Mth.lerp(partialTicks, pEntity.yOld, pEntity.getY()) + pEntity.getEyeHeight(),
                        Mth.lerp(partialTicks, pEntity.zOld, pEntity.getZ())
                );                Vec3 directionToTarget = targetPos.subtract(bossEyePos).normalize();                float targetYaw = (float)Mth.atan2(directionToTarget.x, directionToTarget.z);                float targetPitch = (float)Math.asin(directionToTarget.y);                float entityYaw = Mth.lerp(partialTicks, pEntity.yBodyRotO, pEntity.yBodyRot) * ((float)Math.PI / 180F);                rootPart.yRot = targetYaw - entityYaw;
                rootPart.xRot = -targetPitch; 
            }
        }
    }
